import React from 'react';
import './Styles/Navbar.css';
import Logo from './Logo'

function Navbar() {
    return (
       <div className='Navbar'>
           <div>About</div>
           <div>Products</div>
           <div><Logo /></div>
           <div>Images</div>
           <div>Contact</div>
       </div> 
    );
}

export default Navbar
